import React from 'react';
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

// Component cho bảng duyệt chứng từ
function DuyetChungTuTable() {
  // Mock data để hiển thị
  const mockData = [
    { id: 1, loaiChungTu: 'Chứng từ A', tenNhanVien: 'Nhân viên A', tinhTrang: 'Đã duyệt' },
    { id: 2, loaiChungTu: 'Chứng từ B', tenNhanVien: 'Nhân viên B', tinhTrang: 'Chưa duyệt' },
    { id: 3, loaiChungTu: 'Chứng từ C', tenNhanVien: 'Nhân viên C', tinhTrang: 'Đã duyệt' },
  ];

  return (
    <TableContainer component={Paper} sx={{ marginTop: '24px' }}>
      <Table sx={{ minWidth: 650 }} aria-label="duyet-chung-tu-table">
        <TableHead>
          <TableRow>
            <TableCell>Loại chứng từ</TableCell>
            <TableCell>Tên nhân viên</TableCell>
            <TableCell>Tình trạng</TableCell>
            {/* Thêm các cột khác nếu cần */}
          </TableRow>
        </TableHead>
        <TableBody>
          {mockData.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.loaiChungTu}</TableCell>
              <TableCell>{row.tenNhanVien}</TableCell>
              <TableCell>{row.tinhTrang}</TableCell>
              {/* Thêm các cột khác nếu cần */}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default DuyetChungTuTable;
